import React from 'react'
import "./Home.scss"

const card = ()=>(
  <img src={img} alt="cover" />
)

const Row = ({title})=>(
  <div>
    <h2>{title}</h2>

    <card img={"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.alamy.com%2Fstock-photo%2Favengers-endgame.html&psig=AOvVaw1rJDPw-g4TuFtbCrF0ZWTl&ust=1686289540000000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCKiAipb8sv8CFQAAAAAdAAAAABAE"}/>
  </div>
)


const Home = () => {
  return (
    <section className="home">
      <div className="banner"></div>
    </section>
  )
}

export default Home
